import React from 'react'
import "./style.css"
import 'bootstrap/dist/css/bootstrap.min.css'

class Head extends React.Component {
	render() {
		return (
	    	<header className="typehead">
				<div>
					<pre className="texthead shadow-lg">Numeric!!</pre>	
				</div>
	  		</header>
	  	);
	}
}

export default Head;
